import React from 'react'
import './index.css';

const Common = (props) => {
  const {name , img} = props;
  console.log("name",name);
  return (
    <div className='common'>
      <div>
          <img src={img} ></img>
      </div>

      <div className={name != null? 'textc' : 'textc1'}>
          {props.name}
      </div>

      {/* <div className='textc1'>
          {props.name2}
      </div> */}

    </div>
  )
}

export default Common
